'''{{lang|ja|滅びに至るエランプシス}}'''，是自KONAMI虚拟偶像[[日向美BitterSweets]]的一首曲目。

{{Hide|标题=广播公布的先行版曲|内容={{#widget:YouTube|id=7zHE5tjitRk}}}}

== 简介 ==

该组合的第11部作品，前作为[[走れメロンパン]]，但该曲目被设定为为(实体)专辑而作的新曲，专辑中位置在前作之前。为春日咲子和霜月凛的合作曲。

歌曲为军歌风的摇滚曲，使用了<s>马力全开的中二凛的招牌绝技</s>大量晦涩的旧式词汇。

完整公开是在专辑发售日，并在当日移植到IOS专属音乐游戏pop'n rhythmin。随后和前作一同在jubeat和reflec beat移植。

